return items.map(item => {

  const data = item.json;

  // --- Safe field extraction
  const name = data.name ?? "Unnamed Event";
  const date = data.start_date ?? null;       // "2023-12-04"
  const time = data.start_time ?? null;       // "18:00:00"
  const locationRaw = data.location ?? "Location TBA";
  const description = data.description ?? "No description available.";
  const link = data.link ?? "#";

  // --- Create formatted date string: "Dec 4, 18:00"
  let dateStr = "Date TBA";

  try {
    if (date && time) {
      const d = new Date(`${date}T${time}`);
      const datePart = d.toLocaleDateString("en-US", { month: "short", day: "numeric" });
      const timePart = d.toLocaleTimeString("en-US", { hour: "2-digit", minute: "2-digit", hour12: false });
      dateStr = `${datePart}, ${timePart}`;
    } else if (date) {
      const d = new Date(date);
      const datePart = d.toLocaleDateString("en-US", { month: "short", day: "numeric" });
      dateStr = datePart;
    }
  } catch {}

  // --- Only keep the location name (before first comma)
  const locationName = locationRaw.split(",")[0].trim();

  // --- Final formatted message
  const message =
`üéâ ${name} | ${dateStr}

${description}

üìç ${locationName}
üîó ${link}

Feel free to join, and share it with anyone who might enjoy it ü©µ`;

  return { json: { text: message } };
});

const url = $input.first().json.body.event_link;

try {
  if (typeof url !== "string") {
    return [{ valid: false, reason: "Invalid URL" }];
  }

  // Remove everything after "?"
  const cleaned = url.split("?")[0];

  const blockedDomains = ["youtube.com", "youtu.be", "tiktok.com"];
  const lower = cleaned.toLowerCase();

  if (blockedDomains.some(d => lower.includes(d))) {
    return [{ valid: false, reason: "Disallowed domain" }];
  }

  return [{ valid: true, url: cleaned }];
} catch {
  return [{ valid: false, reason: "Invalid URL" }];
}

return items.map(item => {
  const raw = $('Scrape a url and get its content').first().json.data.json.location;

  if (!raw || typeof raw !== "string") {
    return { json: { location: null } };
  }

  // Split by commas
  const parts = raw.split(",").map(p => p.trim());
  const first = parts[0];

  // Detect a street pattern: ends with a number (e.g. "Pacellistra√üe 2")
  const looksLikeStreet = /\b\d+$/.test(first);

  if (!looksLikeStreet) {
    // First part is a real venue name
    return {
      json: {
        location: first
      }
    };
  }

  // Otherwise, it's a street ‚Üí no venue name found
  return {
    json: {
      location: raw
    }
  };
});

// 1. Pull date from previous node
const raw = $('Scrape a url and get its content').first().json.data.json.date;

if (!raw) {
  return [{
    json: {
      start_date: null,
      start_time: null,
      error: "No date provided"
    }
  }];
}

try {
  let dateObj;

  // Detect if a timezone exists
  const hasTimezone = /[+-]\d{2}:\d{2}$/.test(raw) || raw.endsWith("Z");

  if (hasTimezone) {
    // Parse directly when timezone provided
    dateObj = new Date(raw);
  } else {
    // No timezone ‚Üí interpret as Europe/Berlin local time
    const [datePart, timePart] = raw.split("T");
    const [year, month, day] = datePart.split("-").map(Number);
    const [hh, mm, ss] = (timePart || "00:00:00").split(":").map(Number);

    // Step 1: Construct UTC representation
    const asUTC = new Date(Date.UTC(year, month - 1, day, hh, mm, ss));

    // Step 2: Convert that UTC to actual Berlin local time
    const berlinString = asUTC.toLocaleString("en-US", { timeZone: "Europe/Berlin" });
    dateObj = new Date(berlinString);
  }

  // Force valid year
  if (dateObj.getFullYear() < 2025) {
    dateObj.setFullYear(2025);
  }

  // Format into Berlin components
  const berlinFormatter = new Intl.DateTimeFormat("de-DE", {
    timeZone: "Europe/Berlin",
    year: "numeric",
    month: "2-digit",
    day: "2-digit",
    hour: "2-digit",
    minute: "2-digit",
    second: "2-digit"
  });

  const parts = berlinFormatter.formatToParts(dateObj);
  const mapped = Object.fromEntries(parts.map(p => [p.type, p.value]));

  const start_date = `${mapped.year}-${mapped.month}-${mapped.day}`;
  const start_time = `${mapped.hour}:${mapped.minute}:${mapped.second}`;

  // NEW: Outputs for Google Calendar ‚Üí based on REAL EVENT DATE
  const startDateISO = dateObj.toISOString();
  const startDateObject = dateObj;

  return [{
    json: {
      start_date,
      start_time,
      timezone: "Europe/Berlin",
      startDateISO,
      startDateObject,
    }
  }];

} catch (err) {
  return [{
    json: {
      start_date: null,
      start_time: null,
      error: "Invalid date format"
    }
  }];
}

